import { forwardRef } from "react";

interface Props {
  innerText: string;
  className: string;
  type: string;
  id: string;
  err?: string;
}

function Field(
  { innerText, className, type, err, id, ...props }: Props,
  ref: any
) {
  console.log(props);

  return (
    <div>
      <label htmlFor={id}>{innerText}</label>
      <input ref={ref} type={type} className={className} id={id} {...props} />
    </div>
  );
}

export default forwardRef(Field);
